      position: 'relative',
        borderRadius: 15,
        margin: '30px 0',
        display: 'flex',
        flexDirection: 'column',
        justifyContent: 'space-evenly',
        alignItems: 'center',
      },
      heading: {
        position:'absolute',
        color: '',
      },
      image: {
        // marginLeft: '15px',
        borderRadius: 10,
      },
}))
